import { FormLabel, Input} from "@material-ui/core";
import { Form } from "react-bootstrap";
import Button from "@material-ui/core/Button";
import { Grid } from "@material-ui/core";
import { TextField } from "material-ui";

function UserForm({setAge, setUsername, setEmail, setPassword, setPasswordConfirmation, setFirstName, setLastName, firstName}) {
// function UserForm({setImage}) {

  // console.log("UserForm", image)

  return (
    <>
      <Form 
      // encType="multipart/form-data"
      >

        <Grid item xs={6}>
          <TextField
          varient="outlined"
          label="First Name"
          value={firstName}
          onChange = {e=>setFirstName(e.target.value)}
          />
        </Grid>

        <FormLabel>First Name</FormLabel>
        <Input
          type="text"
          name="first_name"
          onChange={(e) => setFirstName(e.target.value)}
        ></Input>

        <FormLabel>Last Name</FormLabel>
        <Input
          type="text"
          name="last_name"
          onChange={(e) => setLastName(e.target.value)}
        ></Input> 

        <FormLabel>Email</FormLabel>
        <Input
          type="text"
          name="email"
          onChange={(e) => setEmail(e.target.value)}
        ></Input>

        <FormLabel>Username</FormLabel>
        <Input
          type="text"
          id="username"
          onChange={(e) => setUsername(e.target.value)}
        ></Input>

        <FormLabel>Password</FormLabel>
        <Input
          type="password"
          id="password"
          onChange={(e) => setPassword(e.target.value)}
        ></Input>

        <FormLabel>Confirm Password</FormLabel>
        <Input
          type="password"
          id="password_confirmation"
          onChange={(e) => setPasswordConfirmation(e.target.value)}
        ></Input>

          <Button type="submit" color="primary" autoFocus>
          Submit
        </Button>

      </Form>
    </>
  );
}
export default UserForm;
